}
.responsive-nav .nav-links li:nth-child(2) {
  transition: all 0.2s ease 0.2s;
}
.responsive-nav .nav-links li:nth-child(3) {
  transition: all 0.2s ease 0.3s;
}
.responsive-nav .nav-links li:nth-child(4) {
  transition: all 0.2s ease 0.4s;
}
.responsive-nav li.fade {
  opacity: 1;
}
.responsive-nav .nav-links.open {
  clip-path: circle(1000px at 90% -20%);
  -webkit-clip-path: circle(1000px at 90% -20%);
}

